window.bookSummaryJSON = "<p><i>It was a game, now it's his life.</i></p> <p><b>The </b><b><i>Sky Realms Online Complete Series Box Set</i></b><b> is an epic LitRPG adventure set in a virtual world where anything can happen...maybe even death.</b></p> <p>Hall had played the VRMMORPG <i>Sky Realms Online</i> since beta. During one gaming session, a freak accident traps Hall and other players in the game. They awaken to find out their bodies are comatose and that they have been downloaded fully into the virtual world. Even worse, the rules have changed, they've been forced back to level one, and permadeath might be possible.</p> <p>Join Hall and his growing circle of friends and enemies, both Players and NPCs, as they discover that <i>Sky Realms Online</i> is not the same game they knew. New lands, new foes, and new mysteries.</p> <p><b>Grab this special-edition full series omnibus today and dive headfirst into the action-packed world of Sky Realms Online. It's a LitRPG saga perfect for fans of J.A. Hunter, Dakota Krout, and Edward Brody.</b></p>"; 
